I’m honored to have been asked and proud to have been involved to be a part of this ground breaking exposé documentary. 
The Australian Government has been waging a one sided and brutal war against sharks since 1930 with no recourse for updating their archaic cull. 
Thank you for the hard work you’ve put into this @envoyfilm , and to the many friends and shark warriors that stand up in this film and every day to help people understand the reality. 
